async function loadJSON() {
  try {
    const response = await fetch('./json/chart.json');
    if (!response.ok) {
      throw new Error('Ошибка загрузки файла');
    }
    const data = await response.json();
    console.log(data);
    return data.Data;
  } catch (error) {
    console.error('Ошибка:', error);
    return null;
  }
}
